import Card from './Card';

import Button from './Button';

const ErrorModal = props => {
	return (
		<Card name='modal'>
			<header className='header'>
				<h2>{props.title}</h2>
			</header>
			<div className='content'>
				<p>{props.message}</p>
			</div>
			<footer className='actions'>
				<Button>Okay</Button>
			</footer>
		</Card>
	);
};

export default ErrorModal;
